<template>
    <el-container>
    <el-header class="header_text">TUNIC TRANSLATOR</el-header>
    <el-main>
        <el-row type="flex">
        <el-col :span="9" :offset="1">
            <el-row :gutter="0" class="row1">
                <el-col :span="3" :offset="0">
                    <div class="text">Row:</div>
                </el-col>
                <el-col :span="8" :offset="0">
                    <el-input-number v-model="line"  :min="1" :max="20"></el-input-number>
                </el-col>
                <el-col :span="3" :offset="1">
                    <div class="text">Col:</div>
                </el-col>
                <el-col :span="8" :offset="0">
                    <el-input-number v-model="char"  :min="5" :max="50"></el-input-number>
                </el-col>
            </el-row>
            <el-row :gutter="0" class="row2">
                <div class="input">
                    <el-input class="input_text" type="textarea" :rows="10" v-model="string" placeholder="Please input"></el-input>
                </div>
            </el-row>
        </el-col>
        <el-col :span="3" :offset="0">
          <div class="button">
              <el-button type="success" icon="el-icon-d-arrow-right" :loading="isLoading" @click="Translate()" plain></el-button>
          </div>
        </el-col>
        <el-col :span="12" :offset="0">
            <div class="image">
                <img :src=" 'data:image/jpg;base64,' + img" class="image_show">
            </div>
        </el-col>
        </el-row>
    </el-main>
    </el-container>
</template>

<script>

export default {
  name: 'Translator',
  data() {
    return {
      string: "Tunic is an action adventure about a tiny fox in a big world.\n\nExplore the wilderness,\ndiscover spooky ruins,\nand fight terrible creatures from long ago!",
      line: 8,
      char: 25,
      img:"",
      isLoading:false
    };
  },
  methods: {
    Translate() {
      var that = this;
      that.isLoading=true    
      that.$axios
        .post("/translate", {
          str: that.string,
          line: that.line,
          char: that.char
        })
        .then((response) => {
            that.isLoading=false
            that.img=response.data.code
            that.$message.success(response.data.message);
            console.log(response)
        })
        .catch(function(error) {
            that.isLoading=false
            that.$message.error(error.response.data.message);
            console.log(error)
        });
      
    }
  }
}
</script>


<style>
.header_text{
    font-size: 45px;
}
.row1{
    margin-top: 25px;
    margin-bottom: 50px;
}
.text{
    margin-top:9px;
    text-align: center;

}
.input{
    height: 365px;
}
.el-textarea__inner{
    font-size: 20px !important; 
    font-family:'Times New Roman', Times, serif !important;
}
.button{
    margin-top: 200px;
}
.el-button{
    width: 70px;
    height: 90px;
    font-size: 30px;
}
.image{
    border:1px solid #000;
    height: 480px;
}
.image_show{
    height: 999px;
    max-width: 100%;
    max-height: 100%;
    object-fit: contain;
    display: block;
    margin: auto;
}
</style>